import React, {useState, useEffect}  from 'react';
import axios from 'axios';


export default function TelaInfo() {

    const [pessoa, setPessoa] = useState([])

    const getProfileToChoose = () => {
        axios
          .get(
            "https://us-central1-missao-newton.cloudfunctions.net/astroMatch/nastia/person",

          )
          .then(res => {
           console.log(res.data);
           setPessoa(res.data)

          })
          .catch(err => {
            console.log(err);
          })

      };
      useEffect(() => {
        getProfileToChoose(pessoa);
      }, []);



  return (
    <div>
        <im>{pessoa.profile.photo}</im>
       <div> 
        {pessoa.profile.photo}<br/>
        {pessoa.profile.name}<br/>
        {pessoa.profile.age}<br/>
        {pessoa.profile.bio}<br/>
       </div>
    </div>
)
}
